0.51513671875]]], [[[158.87880859375002, -54.70976562500002], [158.84521484375, -54.74921875000001], [158.8359375, -54.704003906249994], [158.89697265625, -54.50605468750001], [158.95888671875002, -54.47236328125001], [158.94560546875005, -54.57500000000002], [158.87880859375002, -54.70976562500002]]]], "type": "MultiPolygon"}, "id": "2", "properties": {"Couleur": ["Vert", "Orange", "Vert", "Vert", "Vert", "Vert", "Vert"], "Country": "Australia", "Disease": ["M\u00e9ningite \u00e0 meningo B", "Enc\u00e9phalite de la vall\u00e9e de Murray", "M\u00e9ningite \u00e0 M\u00e9ningo B", "Legionelle", "Enc\u00e9phalite de la vall\u00e9e de Murray", "H\u00e9patite A", "Enc\u00e9phalite japonnaise"], "final_color": "yellow", "legend": "\u003ch4\u003eAustralia\u003c/h4\u003e\u003cp\u003e\u003cu\u003e21/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eEnc\u00e9phalite japonnaise\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.miragenews.com/japanese-encephalitis-virus-found-in-kimberley-970718/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003epoulets et cochons infect\u00e9s et risques de cas humains dans le Kimberley\u003c/p\u003e\u003cp\u003e\u003cu\u003e05/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eM\u00e9ningite \u00e0 M\u00e9ningo B\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.goldcoastbulletin.com.au/news/nsw/nsw-health-issues-meningococcal-disease-alert-after-sydney-man-dies/news-story/544e7a616b1a4200f0fc01e333fcde01?btr=12cc80f661fed2b8919eb68086cbf4f0 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe minist\u00e8re de la sant\u00e9 de la Nouvelle-Galles du Sud (NSW) a demand\u00e9 \u00e0 la population d\u0027\u00eatre attentive aux sympt\u00f4mes de la m\u00e9ningococcie apr\u00e8s qu\u0027un homme soit d\u00e9c\u00e9d\u00e9 et que trois nouveaux cas aient \u00e9t\u00e9 diagnostiqu\u00e9s dans l\u0027\u00c9tat.\n\nUn quinquag\u00e9naire de Sydney est d\u00e9c\u00e9d\u00e9 des suites de la maladie, tandis que deux adolescents de Sydney et une personne d\u0027une soixantaine d\u0027ann\u00e9es de la c\u00f4te centrale sont en convalescence. Aucun des cas ne semble li\u00e9 \u00e0 la maladie.\u003c/p\u003e\u003cp\u003e\u003cu\u003e24/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eEnc\u00e9phalite de la vall\u00e9e de Murray\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://outbreaknewstoday.com/australia-14-murray-valley-encephalitis-cases-reported-in-2023-to-date-40266/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eUn cas suppl\u00e9mentaire d\u0027enc\u00e9phalite de la vall\u00e9e de Murray (MVE) a \u00e9t\u00e9 confirm\u00e9 en Australie occidentale, selon les autorit\u00e9s sanitaires la semaine derni\u00e8re [semaine du 15 mai 2023]. L\u0027adulte a tr\u00e8s probablement \u00e9t\u00e9 expos\u00e9 \u00e0 des moustiques infect\u00e9s lors d\u0027un voyage depuis le Pilbara \u00e0 travers les r\u00e9gions c\u00f4ti\u00e8res du Kimberley occidental fin avril/d\u00e9but mai. Le cas est soign\u00e9 \u00e0 l\u0027h\u00f4pital.\nIl s\u0027agit du 4e cas confirm\u00e9 de MVE signal\u00e9 en WA depuis 2018 et du 3e cas signal\u00e9 cette ann\u00e9e [2023]. Dans toute l\u0027Australie, il y a eu 14 cas confirm\u00e9s de MVE en 2023.\u003c/p\u003e\u003cp\u003e\u003cu\u003e08/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eEnc\u00e9phalite de la vall\u00e9e de Murray\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.abc.net.au/news/2023-06-07/murray-valley-encephalitis-nt-outbreak-record-cases-warning/102449034 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003ePoints cl\u00e9s :\n- 7 infections et 2 d\u00e9c\u00e8s ont \u00e9t\u00e9 enregistr\u00e9s sur le territoire cette ann\u00e9e [2023].\n- NT Health a \u00e9mis une alerte de sant\u00e9 publique et a demand\u00e9 \u00e0 la population de prendre des pr\u00e9cautions.\n- NT Health indique que le nombre \u00e9lev\u00e9 de cas est probablement li\u00e9 aux fortes pluies et aux inondations.\n\nNT Health indique que le territoire conna\u00eet une \u00e9pid\u00e9mie d\u0027enc\u00e9phalite de la vall\u00e9e de Murray (MVE) apr\u00e8s avoir enregistr\u00e9 le plus grand nombre de cas en une seule ann\u00e9e.\n\nSept cas de cette maladie transmise par les moustiques ont \u00e9t\u00e9 enregistr\u00e9s dans le NT [Territoire du Nord] depuis le d\u00e9but de l\u0027ann\u00e9e [2023], et deux personnes sont d\u00e9c\u00e9d\u00e9es : un nourrisson dans la r\u00e9gion de Katherine et une femme adulte \u00e0 Darwin.\n\nEn comparaison, 2 cas et aucun d\u00e9c\u00e8s ont \u00e9t\u00e9 enregistr\u00e9s au cours des 5 ann\u00e9es pr\u00e9c\u00e9dentes.\n\nAu moins deux des cas de cette ann\u00e9e [2023] concernaient des nourrissons, tandis que la derni\u00e8re personne infect\u00e9e - qui aurait contract\u00e9 la maladie dans le Top End entre avril et mai [2023] - a \u00e9t\u00e9 hospitalis\u00e9e et reste dans un \u00e9tat critique.\n\nLa MVE est une maladie potentiellement mortelle transmise par des moustiques porteurs du virus de la MVE. Les sympt\u00f4mes comprennent des maux de t\u00eate, de la fi\u00e8vre, de la somnolence, des tremblements et des crises d\u0027\u00e9pilepsie. Les cas graves peuvent conduire au d\u00e9lire, au coma et \u00e0 des l\u00e9sions c\u00e9r\u00e9brales permanentes.\n\nCe virus est similaire \u00e0 un autre virus transmis par les moustiques, l\u0027enc\u00e9phalite japonaise, qui a \u00e9galement \u00e9t\u00e9 d\u00e9tect\u00e9e r\u00e9cemment dans le NT.\u003c/p\u003e\u003cp\u003e\u003cu\u003e27/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eLegionelle\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.health.vic.gov.au/health-alerts/legionnaires-disease-linked-to-cheltenham-area \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe d\u00e9partement [Department of Health] enqu\u00eate sur une \u00e9pid\u00e9mie de maladie du l\u00e9gionnaire \u00e0 Cheltenham et dans les banlieues environnantes [Victoria]. 3 cas ont \u00e9t\u00e9 notifi\u00e9s au 26 mai 2023.\n\nLes personnes ayant s\u00e9journ\u00e9 \u00e0 Cheltenham ou dans les banlieues environnantes depuis le d\u00e9but du mois de mai [2023] et qui d\u00e9veloppent un syndrome grippal doivent consulter d\u0027urgence un m\u00e9decin.\n\nLes professionnels de sant\u00e9 doivent \u00eatre attentifs \u00e0 la pr\u00e9sence de l\u00e9gionellose chez les patients pr\u00e9sentant des sympt\u00f4mes grippaux, en particulier ceux qui pr\u00e9sentent une pneumonie atypique ou s\u00e9v\u00e8re et qui ont r\u00e9cemment s\u00e9journ\u00e9 \u00e0 Cheltenham ou dans les banlieues environnantes. En cas de suspicion de maladie du l\u00e9gionnaire, demandez un test d\u0027antig\u00e8ne urinaire \u00e0 votre fournisseur habituel de services de pathologie. En priorit\u00e9, demandez une culture de _Legionella_ sur les expectorations et une s\u00e9rologie sur le sang \u00e0 l\u0027apparition des sympt\u00f4mes et 3 \u00e0 6 semaines plus tard (en tant que s\u00e9rologie de convalescence).\u003c/p\u003e\u003cp\u003e\u003cu\u003e22/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eH\u00e9patite A\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.zinc96.com.au/local-news/multiple-cases-of-hepatitis-a-detected-in-gympie/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003ecluster familial \u00e0 Gympie dans le Queensland secondaire \u00e0 cas import\u00e9\u003c/p\u003e\u003cp\u003e\u003cu\u003e09/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eM\u00e9ningite \u00e0 meningo B\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.nationaltribune.com.au/meningococcal-case-7-june-2023/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eUn cas de m\u00e9ningococcie invasive a \u00e9t\u00e9 notifi\u00e9 chez un homme de 53 ans de la r\u00e9gion m\u00e9tropolitaine d\u0027Ad\u00e9la\u00efde. Le patient a \u00e9t\u00e9 admis \u00e0 l\u0027h\u00f4pital et se trouve dans un \u00e9tat critique. La souche a \u00e9t\u00e9 identifi\u00e9e comme \u00e9tant de s\u00e9rotype B. SA [South Australia] Health a identifi\u00e9 plusieurs personnes ayant \u00e9t\u00e9 en contact avec le patient, dont deux ont \u00e9t\u00e9 invit\u00e9es \u00e0 recevoir une prophylaxie. Neuf cas de m\u00e9ningococcie invasive ont \u00e9t\u00e9 signal\u00e9s en Australie-M\u00e9ridionale cette ann\u00e9e [2023], contre cinq cas enregistr\u00e9s l\u0027ann\u00e9e derni\u00e8re \u00e0 la m\u00eame \u00e9poque [2022]. Sur les 9 cas signal\u00e9s depuis le d\u00e9but de l\u0027ann\u00e9e, 8 sont du s\u00e9rogroupe B et 1 du s\u00e9rogroupe W.\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[[89.05146484375001, 22.093164062500136], [89.05585937500001, 22.186230468750068], [89.05000000000001, 22.274609374999997], [88.97148437499999, 22.510937499999997], [88.92070312499999, 22.632031249999955], [88.92695312500001, 22.671142578125114], [88.92343750000003, 22.687548828125102], [88.89970703124999, 22.843505859375057], [88.86699218749999, 22.938867187499994], [88.8505859375, 23.04052734375], [88.92812500000002, 23.18662109374999], [88.89707031250003, 23.210400390624997], [88.8076171875, 23.229687499999997], [88.72441406249999, 23.254980468750034], [88.70400390625002, 23.29282226562499], [88.74082031250003, 23.43662109374999], [88.69765625000002, 23.493017578125034], [88.6357421875, 23.549999999999997], [88.61640625000001, 23.572753906250114], [88.59599609374999, 23.602197265624994], [88.5673828125, 23.67441406249999], [88.62255859375, 23.826367187500125], [88.69980468750003, 24.00253906249999], [88.71376953125002, 24.069628906250003], [88.7265625, 24.186230468749997], [88.73359375000001, 24.230908203124997], [88.72353515625002, 24.27490234375], [88.64228515625001, 24.325976562500003], [88.49853515624994, 24.346630859375068], [88.39697265625, 24.38925781249999], [88.33750000000003, 24.453857421875], [88.287109375, 24.479736328125], [88.22500000000002, 24.46064453125001], [88.1455078125, 24.485791015624997], [88.0791015625, 24.54990234374999], [88.0234375, 24.627832031250136], [88.0302734375, 24.664453124999994], [88.04511718750001, 24.713037109374994], [88.14980468750002, 24.91464843749999], [88.18886718750002, 24.920605468749997], [88.27949218750001, 24.88193359374999], [88.31337890625002, 24.8818359375], [88.37294921875002, 24.96152343749999], [88.45625000000001, 25.188427734374997], [88.57382812500003, 25.187890624999994], [88.67753906249999, 25.1804687 ], [-50.65288085937499, -0.13164062500000284]]], [[[-49.44389648437499, -0.11240234375000568], [-49.708837890625006, -0.14375000000001137], [-49.830078125, -0.09389648437500853], [-49.80268554687498, -0.051855468750005684], [-49.712304687499994, 0.01513671875], [-49.602197265624994, 0.06269531249999716], [-49.50346679687499, 0.08369140624999716], [-49.400488281250006, 0.057226562499991473], [-49.372314453125, 0.0010742187499914735], [-49.380859375, -0.05546875000000284], [-49.44389648437499, -0.11240234375000568]]], [[[-50.426123046875006, 0.13925781249999147], [-50.443945312500006, -0.007666015625005684], [-50.623925781249994, 0.05439453124999716], [-50.610449218750006, 0.20478515624999716], [-50.526220703125006, 0.24692382812499147], [-50.451562499999994, 0.326904296875], [-50.42607421874999, 0.4249511718749943], [-50.424560546875, 0.5582519531249943], [-50.396874999999994, 0.5813964843749915], [-50.37275390624998, 0.5908691406249886], [-50.350976562499994, 0.5817382812499972], [-50.342529296875, 0.381591796875], [-50.332275390625, 0.259033203125], [-50.426123046875006, 0.13925781249999147]]], [[[-50.152929687500006, 0.39301757812499716], [-50.261328125000006, 0.35917968749998863], [-50.28154296874999, 0.39082031249999716], [-50.28168945312498, 0.5165039062499943], [-50.25117187499998, 0.58544921875], [-50.11279296875, 0.604736328125], [-50.0986328125, 0.625], [-50.058837890625, 0.6380371093749915], [-50.03681640624998, 0.5948242187499915], [-50.0400390625, 0.5228027343749915], [-50.152929687500006, 0.39301757812499716]]], [[[-51.83251953125, -1.4337890625000114], [-51.938378906249994, -1.45263671875], [-51.80205078124999, -1.2025390625000085], [-51.680029296875006, -1.0861328125000114], [-51.67827148437499, -0.8550781250000057], [-51.546044921874994, -0.6496093750000114], [-51.424462890624994, -0.56591796875], [-51.254003906250006, -0.5414062500000085], [-51.160742187500006, -0.6666992187500114], [-51.27631835937498, -1.0217773437500028], [-51.31010742187499, -1.0238281250000085], [-51.46513671874999, -1.2111328125000114], [-51.6376953125, -1.3418945312500057], [-51.83251953125, -1.4337890625000114]]], [[[-48.48588867187499, -27.76699218750001], [-48.554589843749994, -27.81220703125001], [-48.54218749999998, -27.574804687500006], [-48.50517578124999, -27.49550781250001], [-48.464746093749994, -27.436328125000003], [-48.414892578125006, -27.39960937500001], [-48.3779296875, -27.451464843750003], [-48.409570312499994, -27.56630859375001], [-48.49677734374998, -27.70703125], [-48.48588867187499, -27.76699218750001]]]], "type": "MultiPolygon"}, "id": "5", "properties": {"Couleur": ["Orange", "Orange", "Vert", "Orange", "Vert"], "Country": "Brazil", "Disease": ["Grippe A H1N1 d\u0027origine porcine", "Chikungunya", "Fi\u00e8vre jaune", "West Nile", "rage"], "final_color": "yellow", "legend": "\u003ch4\u003eBrazil\u003c/h4\u003e\u003cp\u003e\u003cu\u003e11/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eChikungunya\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://promedmail.org/promed-post/?id=8710530 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003ePanama, Br\u00e9sil, Argentine, Paraguay, Uruguay\u003c/p\u003e\u003cp\u003e\u003cu\u003e01/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003erage\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.mesvaccins.net/web/news/20737-bresil-premier-cas-de-rage-humaine-transmis-par-du-betail-signale-dans-le-minas-gerais-cette-annee \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eAu Br\u00e9sil, un \u00e9leveur de 60 ans de Mantena, dans l\u0027est du Minas Gerais, a re\u00e7u un diagnostic de rage humaine confirm\u00e9  le 15 avril 2023.  Au Br\u00e9sil, la rage est end\u00e9mique et se maintient dans les cycles \"a\u00e9rien, sylvatique et rural\", o\u00f9 les chauves-souris sont les principaux r\u00e9servoirs. Les chauves-souris vampires de l\u0027esp\u00e8ce Desmodus rotundus restent les r\u00e9servoirs naturels du virus. Comme D. rotundus se nourrit de pr\u00e9f\u00e9rence sur le b\u00e9tail, le caract\u00e8re end\u00e9mique de la rage chez le b\u00e9tail est maintenu, ce qui donne lieu \u00e0 des \u00e9pid\u00e9mies sporadiques de la maladie.\n\nL\u0027homme a \u00e9t\u00e9 initialement trait\u00e9 \u00e0 l\u0027h\u00f4pital public Dr. Alceu Melga\u00e7o Filho \u00e0 Barra do S\u00e3o Francisco (HDAMF), dans l\u0027\u00c9tat d\u0027Esp\u00edrito Santo (ES), le 7 avril. Le patient pr\u00e9sentait une confusion mentale et une aggravation clinique qui a abouti \u00e0 son transfert \u00e0 l\u0027unit\u00e9 de soins intensifs (8 avril) du m\u00eame h\u00f4pital, o\u00f9 l\u0027hypoth\u00e8se diagnostique de la rage humaine a \u00e9t\u00e9 sugg\u00e9r\u00e9e. Le 16 avril, compte tenu de la gravit\u00e9 de l\u0027\u00e9tat, le transfert \u00e0 l\u0027h\u00f4pital de l\u0027\u00c9tat Dr. Jayme dos Santos Neves, dans la municipalit\u00e9 de Serra-ES a \u00e9t\u00e9 d\u00e9cid\u00e9. Le patient est toujours hospitalis\u00e9 dans un \u00e9tat critique.\u003c/p\u003e\u003cp\u003e\u003cu\u003e15/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eGrippe A H1N1 d\u0027origine porcine\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON473 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe 7 juin 2023, le Br\u00e9sil a notifi\u00e9 \u00e0 l\u0027Organisation mondiale de la sant\u00e9 (OMS) un cas humain mortel confirm\u00e9 en laboratoire d\u0027infection par un virus de la grippe A(H1N1) variante (v) d\u0027origine porcine dans l\u0027\u00c9tat int\u00e9rieur du Paran\u00e1.\n\nDes cas humains sporadiques de grippe A(H1N1)v ont \u00e9t\u00e9 signal\u00e9s pr\u00e9c\u00e9demment, y compris au Br\u00e9sil. Selon le R\u00e8glement sanitaire international (RSI) 2005, une infection humaine caus\u00e9e par un nouveau sous-type de virus grippal A est un \u00e9v\u00e9nement susceptible d\u0027avoir un impact important sur la sant\u00e9 publique et doit \u00eatre notifi\u00e9 \u00e0 l\u0027OMS.\n\nSur la base des informations actuellement disponibles, l\u0027OMS consid\u00e8re qu\u0027il s\u0027agit d\u0027un cas sporadique et qu\u0027il n\u0027y a pas de preuve de transmission de personne \u00e0 personne. La probabilit\u00e9 d\u0027une propagation au niveau communautaire parmi les humains et/ou d\u0027une propagation internationale de la maladie par l\u0027interm\u00e9diaire des humains est faible\u003c/p\u003e\u003cp\u003e\u003cu\u003e15/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eWest Nile\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://g1.globo.com/to/tocantins/noticia/2023/05/11/adolescente-com-febre-do-nilo-ocidental-esta-internado-na-uti-do-hgp-ha-cerca-de-30-dias.ghtml \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eL\u0027adolescent de 16 ans chez qui le West nile  a \u00e9t\u00e9 diagnostiqu\u00e9e a \u00e9t\u00e9 admis \u00e0 l\u0027unit\u00e9 de soins intensifs de l\u0027h\u00f4pital g\u00e9n\u00e9ral de Palmas (HGP) [Tocantins] pendant environ 30 jours. L\u0027information provient du Secr\u00e9tariat d\u0027\u00c9tat \u00e0 la sant\u00e9. Il s\u0027agit du premier cas de la maladie enregistr\u00e9 \u00e0 Tocantins [\u00e9tat]. Le diagnostic a \u00e9t\u00e9 pos\u00e9 ce mercredi (10 mai 2023), suite aux r\u00e9sultats des analyses de laboratoire effectu\u00e9es \u00e0 l\u0027Instituto Evandro Chagas, \u00e0 Bel\u00e9m\u003c/p\u003e\u003cp\u003e\u003cu\u003e29/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eFi\u00e8vre jaune\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://en.mercopress.com/2023/05/29/yellow-fever-deaths-recorded-again-in-s-o-paulo \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e2 cas fatals apr\u00e8s une absence de cas depuis 2020 (\u00e9tat de Sao Paulo et Minas Geiras)\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[[-132.655517578125, 54.127490234374996], [-132.5640625, 54.068652343749996], [-132.34443359375, 54.1060546875], [-132.303369140625, 54.098876953125], [-132.26162109375, 54.076318359375], [-132.21591796875, 54.02841796875], [-132.16611328125, 53.955224609375], [-132.155126953125, 53.8751953125], [-132.17509765625, 53.846533203125], [-132.214501953125, 53.814746093749996], [-132.564892578125, 53.687646484375], [-132.57412109375, 53.675390625], [-132.567138671875, 53.66396484375], [-132.53466796875, 53.651708984375], [-132.464404296875, 53.6533203125], [-132.186962890625, 53.684814453125], [-132.1716796875, 53.706835937499996], [-132.15224609375, 53.806982421875], [-132.114013671875, 53.860156249999996], [-132.110595703125, 53.90029296875], [-132.135888671875, 53.995849609375], [-132.134423828125, 54.03427734375], [-131.9408203125, 54.0419921875], [-131.81962890625, 54.07734375], [-131.695947265625, 54.1431640625], [-131.667626953125, 54.141357421875], [-131.685400390625, 54.022802734375], [-1 3cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://outbreaknewstoday.com/chile-2nd-child-from-los-lagos-contracts-hantavirus-40491/\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e\"Le Secr\u00e9tariat r\u00e9gional minist\u00e9riel (SEREMI) de la sant\u00e9 de la r\u00e9gion de Los Lagos a confirm\u00e9 un nouveau cas d\u0027hantavirus dans la zone rurale de la commune de Puerto Montt.\n\nLe patient est un habitant du secteur Piedra Azul \u00e2g\u00e9 de 10 ans. Il s\u0027agit du deuxi\u00e8me cas chez un enfant cette ann\u00e9e [2023]\".\u003c/p\u003e\u003cp\u003e\u003cu\u003e21/04/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003ecas humains de grippe aviaire H5N1\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON461 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e1 cas: Homme de 53 ans originaire de la r\u00e9gion d\u0027Antofagasta, dans le nord du Chili. Il n\u0027avait aucun ant\u00e9c\u00e9dent de comorbidit\u00e9 ni de voyage r\u00e9cent.\n\nLe 13 mars 2023, le patient a pr\u00e9sent\u00e9 toux, maux de gorge et enrouement. Le 21 marsaggravation des sympt\u00f4mes Le 22 mars 2023 dyspn\u00e9e,  \u00e9couvillon nasopharyng\u00e9 s\u0027est r\u00e9v\u00e9l\u00e9 n\u00e9gatif pour le SARS-CoV-2. Le 23 mars, le patient a \u00e9t\u00e9 admis en unit\u00e9 de soins intensifs et un traitement \u00e0 base d\u0027antiviraux (oseltamivir) et d\u0027antibiotiques a \u00e9t\u00e9 mis en place, avec une ventilation m\u00e9canique. Les pr\u00e9cautions standard de contr\u00f4le de l\u0027infection ont \u00e9t\u00e9 respect\u00e9es depuis la d\u00e9tection du cas.  Le 5 avril, les r\u00e9sultats du s\u00e9quen\u00e7age g\u00e9nomique ont \u00e9t\u00e9 compl\u00e9t\u00e9s par le NIC au Chili, qui a identifi\u00e9 le virus de l\u0027influenza aviaire A(H5N1) du clade phylog\u00e9n\u00e9tique 2.3.4.4b. Le s\u00e9quen\u00e7age g\u00e9nomique pr\u00e9sentait une identit\u00e9 de 99,9 % avec les s\u00e9quences d\u0027h\u00e9magglutinine H5 d\u0027oiseaux chiliens, et la neuraminidase (NA) compl\u00e8te pr\u00e9sentait une identit\u00e9 de 100 % avec les s\u00e9quences N1 d\u0027oiseaux chiliens.\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[[118.18300781250002, 24.496289062499997], [118.14951171875003, 24.43613281249999], [118.09052734375001, 24.44614257812499], [118.08876953125002, 24.48886718749999], [118.07675781250003, 24.501416015624997], [118.09296875000001, 24.541210937499997], [118.10380859374999, 24.55234374999999], [118.17070312499999, 24.518505859374997], [118.18300781250002, 24.496289062499997]]], [[[121.86269531250002, 31.49228515625], [121.78046875000001, 31.463769531249994], [121.51992187500002, 31.549609374999996], [121.33642578125, 31.643749999999997], [121.22685546874999, 31.758105468749996], [121.21113281250001, 31.805371093749997], [121.33896484375003, 31.79736328125], [121.46416015624999, 31.7564453125], [121.49179687500003, 31.693652343749996], [121.54228515624999, 31.67392578125], [121.57656250000002, 31.6373046875], [121.80830078125001, 31.552148437499994], [121.84365234375002, 31.5263671875], [121.86269531250002, 31.49228515625]]], [[[122.2958984375, 29.963427734374996], [122.28154296874999, 29.94384765625], [122.15781250000003, 30.001269531249996], [122.02402343750003, 30.013330078124994], [121.97783203124999, 30.063818359375], [121.96943359375001, 30.143115234374996], [122.11054687500001, 30.13974609375], [122.28447265624999, 30.068017578124994], [122.322265625, 30.031396484374994], [122.2958984375, 29.963427734374996]]], [[[122.17255859375001,  [-112.13022460937499, 24.72958984374999], [-112.12626953125, 24.654003906249997], [-112.06748046874999, 24.583642578124994], [-112.057275390625, 24.545703125000003]]]], "type": "MultiPolygon"}, "id": "33", "properties": {"Couleur": ["Vert"], "Country": "Mexico", "Disease": ["Fusarium solani (5 samples)"], "final_color": "green", "legend": "\u003ch4\u003eMexico\u003c/h4\u003e\u003cp\u003e\u003cu\u003e02/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eFusarium solani (5 samples)\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON470 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe 11 mai 2023, les CDC am\u00e9ricains ont notifi\u00e9 \u00e0 la DGE du Mexique, par l\u0027interm\u00e9diaire du point focal national du R\u00e8glement sanitaire international (PFN RSI), l\u0027identification de cinq cas f\u00e9minins de CNSI aux \u00c9tats-Unis, ayant subi des interventions chirurgicales sous anesth\u00e9sie rachidienne dans deux cliniques priv\u00e9es d\u0027une ville du Mexique, frontali\u00e8re des \u00c9tats-Unis. La source, le v\u00e9hicule et la voie de transmission de l\u0027\u00e9pid\u00e9mie actuelle restent inconnus, bien que les investigations soient en cours. Au 26 mai 2023, les autorit\u00e9s sanitaires du Mexique et des \u00c9tats-Unis ont signal\u00e9 un total de 20 cas pr\u00e9sentant des signes et des sympt\u00f4mes compatibles avec le CNSI, dont deux d\u00e9c\u00e8s signal\u00e9s par les CDC am\u00e9ricains. Les patients se sont pr\u00e9sent\u00e9s \u00e0 l\u0027h\u00f4pital avec des sympt\u00f4mes comprenant des maux de t\u00eate, de la fi\u00e8vre, des naus\u00e9es, des vomissements, une sensibilit\u00e9 \u00e0 la lumi\u00e8re et des \u00e9vanouissements apr\u00e8s avoir subi des interventions chirurgicales dans deux cliniques priv\u00e9es situ\u00e9es dans la ville de Matamoros, dans l\u0027\u00c9tat de Tamaulipas au Mexique, \u00e0 la fronti\u00e8re avec les \u00c9tats-Unis, entre janvier et avril 2023.\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[-83.15751953124999, 14.993066406249994], [-83.18535156249999, 14.956396484374991], [-83.21591796874999, 14.932373046875], [-83.27988281249999, 14.812792968750003], [-83.302001953125, 14.802099609374991], [-83.30634765625, 14.890527343749994], [-83.344384765625, 14.902099609375], [-83.38901367187499, 14.870654296875003], [-83.413720703125, 14.825341796874994], [-83.37485351562499, 14.76611328125], [-83.34072265625, 14.765283203124994], [-83.29921875, 14.7490234375], [-83.187744140625, 14.340087890625], [-83.21171874999999, 14.267138671875003], [-83.28081054687499, 14.153613281250003], [-83.34658203125, 14.056982421874991], [-83.4123046875, 13.996484374999994], [-83.49374999999999, 13.738818359375003], [-83.567333984375, 13.3203125], [-83.51445312499999, 12.943945312499991], [-83.5412109375, 12.596289062499991], [-83.51796875, 12.514111328124997], [-83.5109375, 12.411816406249997], [-83.56523437499999, 12.393408203124991], [-83.5958984375, 12.396484375], [-83.627197265625, 12.459326171874991], [-83.623681640625, 12.514550781249994], [-83.5912109375, 12.579345703125], [-83.578076171875, 12.667138671874994], [-83.59335937499999, 12.713085937499997], [-83.62534179687499, 12.612890624999991], [-83.681640625, 12.568115234375], [-83.71835937499999, 12.552636718749994], [-83.75424804687499, 12.501953125], [-83.7162109375, 12.40673828125], [-83.66733398437499, 12.337060546874994], [-83.65126953125, 12.287060546874997], [-83.66923828124999, 12.2275390625], [-83.680419921875, 12.024316406249994], [-83.697705078125, 12.029980468749997], [-83.715576171875, 12.057421874999989], [-83.76718749999999, 12.059277343749997], [-83.77333984375, 11.977392578124991], [-83.7693 156250000023, 13.1943359375], [12.65478515625, 13.326562499999994], [12.759960937500011, 13.38037109375], [12.871679687500006, 13.449023437500003], [13.048437500000006, 13.534521484374991], [13.19384765625, 13.573046875000003], [13.323828125000006, 13.670849609374997], [13.426953125000011, 13.701757812499991], [13.606347656250023, 13.70458984375]]]], "type": "MultiPolygon"}, "id": "35", "properties": {"Couleur": ["Rouge", "Rouge", "Rouge", "Orange"], "Country": "Nigeria", "Disease": ["Fi\u00e8vre de Lassa", "Dipht\u00e9rie", "M\u00e9ningite \u00e0 m\u00e9ningo C", "Dipht\u00e9rie"], "final_color": "red", "legend": "\u003ch4\u003eNigeria\u003c/h4\u003e\u003cp\u003e\u003cu\u003e01/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eFi\u00e8vre de Lassa\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:red\"\u003eAlerte \u00e9lev\u00e9e\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON463 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe Nigeria conna\u00eet actuellement une importante flamb\u00e9e de fi\u00e8vre de Lassa, avec 4702 cas suspects, cinq cas probables et 877 cas confirm\u00e9s entre les semaines \u00e9pid\u00e9miologiques 1 et 15 de 2023 (semaine se terminant le 16 avril). Parmi les cas confirm\u00e9s, il y a eu 152 d\u00e9c\u00e8s (CFR 17%). La fi\u00e8vre de Lassa est end\u00e9mique au Nig\u00e9ria et dans certaines r\u00e9gions d\u0027Afrique de l\u0027Ouest o\u00f9 le rat multimammate, principal r\u00e9servoir du virus de Lassa, est r\u00e9pandu. Il s\u0027agit d\u0027une augmentation de 20 % des cas confirm\u00e9s par rapport \u00e0 ceux signal\u00e9s au cours de la m\u00eame p\u00e9riode en 2022 (733).\u003c/p\u003e\u003cp\u003e\u003cu\u003e27/04/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eM\u00e9ningite \u00e0 m\u00e9ningo C\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:red\"\u003eAlerte \u00e9lev\u00e9e\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON454\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eEntre le 1er octobre 2022 et le 16 avril 2023, le Nig\u00e9ria a notifi\u00e9 un total de 1686 cas suspects de m\u00e9ningite, dont 124 d\u00e9c\u00e8s, soit un taux de l\u00e9talit\u00e9 de 7%. Les hommes repr\u00e9sentent 57% (n = 961) du total des cas suspects. La proportion la plus \u00e9lev\u00e9e de cas d\u00e9clar\u00e9s concerne les enfants \u00e2g\u00e9s de 1 \u00e0 15 ans. L\u0027\u00e9tat de Jigawa repr\u00e9sente 74% (n = 1252) de tous les cas suspects, et cet \u00e9tat est limitrophe de la r\u00e9gion de Zinder au Niger, o\u00f9 une \u00e9pid\u00e9mie de m\u00e9ningite a \u00e9t\u00e9 signal\u00e9e depuis octobre 2022. Au total, 481 \u00e9chantillons de liquide c\u00e9phalorachidien ont \u00e9t\u00e9 pr\u00e9lev\u00e9s sur des patients dans 18 \u00c9tats. Sur ces \u00e9chantillons, 247 \u00e9taient confirm\u00e9s li\u00e9s \u00e0 une infection bact\u00e9rienne par PCR. Parmi les cas positifs, 226 (91 %) \u00e9taient dus \u00e0 Neisseria meningitidis s\u00e9rogroupe C (NmC), tandis que 13 cas (5,4 %) \u00e9taient dus \u00e0 Streptococcus pneumoniae et un seul cas (0,4 %) \u00e0 Haemophilus influenzae.\u003c/p\u003e\u003cp\u003e\u003cu\u003e27/04/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eDipht\u00e9rie\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:red\"\u003eAlerte \u00e9lev\u00e9e\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON452\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eDepuis le d\u00e9but de l\u0027ann\u00e9e 2023, 557 cas confirm\u00e9s de dipht\u00e9rie ont \u00e9t\u00e9 d\u00e9tect\u00e9s au Nigeria, touchant 21 des 36 \u00c9tats et le Territoire de la capitale f\u00e9d\u00e9rale. Selon l\u0027enqu\u00eate en grappes \u00e0 indicateurs multiples (MICS) et l\u0027enqu\u00eate nationale sur la couverture vaccinale (NICS) men\u00e9es au Nig\u00e9ria en 2021, la couverture par la troisi\u00e8me dose de vaccin pentavalent \u00e9tait de 57 % en 2021.\u003c/p\u003e\u003cp\u003e\u003cu\u003e20/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eDipht\u00e9rie\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.ncdc.gov.ng/themes/common/files/sitreps/d6dbbc4af6e2781520043f4aee0c031f.pdf \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eEtat de Kano (355 des 377 cas rapport\u00e9s dont 56 d\u00e9c\u00e8s), enfants de 2 \u00e0 14 ans, seuls 15% compl\u00e8tement vaccin\u00e9s\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[76.76689453124999, 35.66171875], [76.81279296874999, 35.571826171874996], [76.88222656250002, 35.4357421875], [76.927734375, 35.346630859375], [76.97890625000002, 35.246435546875], [77.00449218750003, 35.196337890624996], [77.04863281249999, 35.109912109374996], [77.03066406250002, 35.062353515625], [77.00087890625002, 34.991992187499996], [76.89169921875003, 34.938720703125], [76.78291015625001, 34.900195312499996], [76.75751953125001, 34.877832031249994], [76.7490234375, 34.847558593749994], [76.6962890625, 34.78691406249999], [76.59443359375001, 34.73583984375], [76.50996093750001, 34.740869140624994], [76.45673828125001, 34.756103515625], [76.17246093750003, 34.667724609375], [76.041015625, 34.669921875], [75.9382812500 75, -3.7889648437500085], [-70.5296875, -3.8664062500000114], [-70.48583984375, -3.8693359375000114], [-70.42109375, -3.849609375], [-70.37919921874999, -3.8187500000000085], [-70.339501953125, -3.8143554687500085], [-70.29843749999999, -3.84423828125], [-70.24028320312499, -3.8827148437500085], [-70.198388671875, -3.9951171875], [-70.16752929687499, -4.0501953125000085], [-70.09477539062499, -4.0921875000000085], [-70.01718749999999, -4.1620117187500085], [-69.96591796874999, -4.235937500000006]]], "type": "Polygon"}, "id": "39", "properties": {"Couleur": ["Vert", "Orange"], "Country": "Peru", "Disease": ["Leptospirose", "Dengue"], "final_color": "yellow", "legend": "\u003ch4\u003ePeru\u003c/h4\u003e\u003cp\u003e\u003cu\u003e10/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eLeptospirose\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://peru21.pe/peru/leptospirosis-mas-de-6-mil-casos-en-lo-que-va-del-ano-dengue-peru-casos-aumentan-fiebre-hospital-loreto-madre-de-dios-piura-tumbes-noticia/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eJusqu\u0027\u00e0 pr\u00e9sent, en 2023, plus de 6 700 cas de leptospirose ont \u00e9t\u00e9 enregistr\u00e9s dans tout le pays, les r\u00e9gions les plus touch\u00e9es \u00e9tant Loreto, Ica, Tumbes, Madre de Dios et Piura, selon les donn\u00e9es du Centre national d\u0027\u00e9pid\u00e9miologie, de pr\u00e9vention et de contr\u00f4le (CDC) du minist\u00e8re de la sant\u00e9 (Minsa). Le rapport du CDC du minist\u00e8re de la Sant\u00e9 pr\u00e9cise que, jusqu\u0027\u00e0 la semaine \u00e9pid\u00e9miologique 20 (du 14 au 20 mai 2023), un total de 6761 cas a \u00e9t\u00e9 enregistr\u00e9 dans l\u0027ensemble du pays, un chiffre bien sup\u00e9rieur au nombre total de cas accumul\u00e9s en 2022 (4928 c 593750006], [28.439062500000006, -30.14248046875001], [28.499609375000006, -30.12890625], [28.57666015625, -30.123046875], [28.634375000000006, -30.128710937500003], [28.646875000000023, -30.126562500000006], [28.736914062500006, -30.10195312500001]]], [[[37.85693359375, -46.944238281249994], [37.81396484375, -46.962890625], [37.61181640625, -46.94648437500001], [37.59003906250001, -46.90800781250002], [37.64970703125002, -46.84892578125002], [37.68486328125002, -46.82402343750002], [37.78955078125, -46.837500000000006], [37.87285156250002, -46.88544921875001], [37.8876953125, -46.90166015625002], [37.85693359375, -46.944238281249994]]]], "type": "MultiPolygon"}, "id": "46", "properties": {"Couleur": ["Orange", "Orange", "Vert", "Vert"], "Country": "South Africa", "Disease": ["Chol\u00e9ra", "Rage", "Oreillons", "Rougeole"], "final_color": "yellow", "legend": "\u003ch4\u003eSouth Africa\u003c/h4\u003e\u003cp\u003e\u003cu\u003e03/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eChol\u00e9ra\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.sanews.gov.za/south-africa/hammanskraal-cholera-cases-drop-source-remains-elusive \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eL\u0027\u00e9pid\u00e9mie actuelle de chol\u00e9ra, a d\u00e9clar\u00e9 le ministre, remonte aux deux premiers cas signal\u00e9s dans la province de Gauteng en f\u00e9vrier de cette ann\u00e9e. Il s\u2019agissait de deux s\u0153urs de Diepsloot, \u00e0 Johannesburg , qui se sont rendues ensemble en bus au Malawi en janvier et en sont revenues le 30 janvier 2023. Le mari de l\u0027une des femmes a \u00e9galement \u00e9t\u00e9 test\u00e9 positif au chol\u00e9ra apr\u00e8s avoir d\u00e9velopp\u00e9 des sympt\u00f4mes, tandis que huit autres cas ont \u00e9t\u00e9 confirm\u00e9s, entra\u00eenant la mort d\u0027un enfant \u00e0 Ekhuruleni .\n\nDans le bulletin hebdomadaire publi\u00e9e le 21 mai 2023 par la R\u00e9gion Afrique de l\u2019OMS, il \u00e9tait pr\u00e9cis\u00e9 que la province de Gauteng n\u0027avait pas signal\u00e9 de nouveaux cas de chol\u00e9ra au cours des quatre derni\u00e8res semaines, et qu\u2019au 5 mai 2023, un total de 11 cas de chol\u00e9ra, dont un d\u00e9c\u00e8s, ont \u00e9t\u00e9 signal\u00e9s \u00e0 Johannesburg (8) et Ekurhuleni (3).  \n\nLa situation s\u2019est d\u00e9grad\u00e9e au cours du mois de mai. Dans sa communication du 31 mai, le ministre de la sant\u00e9 fait le bilan suivant :\n\nUn important foyer de chol\u00e9ra s\u2019est d\u00e9velopp\u00e9 dans la Municipalit\u00e9 m\u00e9tropolitaine de la ville de Tshwane, \u00c9tat de Gauteng, qui est consid\u00e9r\u00e9e comme l\u2019\u00e9picentre actuel de l\u2019\u00e9pid\u00e9mie. Quatre-vingt dis-neuf cas ont \u00e9t\u00e9 confirm\u00e9s, dont sept au cours des derni\u00e8res 24 heures. Parmi les nouvelles infections, trois patients sont trait\u00e9s \u00e0 l\u0027h\u00f4pital Jubilee, tandis que les autres sont r\u00e9partis entre les h\u00f4pitaux Military, Eugene Marais Life, Netcare Montana et Odi.\u003c/p\u003e\u003cp\u003e\u003cu\u003e24/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eRougeole\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON447 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003ecas dans 8 provinces, pas de d\u00e9c\u00e8s 86% moins de 14 ans, cause: couverture vaccinale insuffisante\u003c/p\u003e\u003cp\u003e\u003cu\u003e02/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eRage\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://outbreaknewstoday.com/south-africa-reports-3-additional-human-rabies-cases-in-past-month-95008/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eDans le cadre du suivi de la situation de la rage humaine en Afrique du Sud en 2023, l\u0027Institut national des maladies transmissibles (NICD) rapporte que 3 cas de rage humaine ont \u00e9t\u00e9 confirm\u00e9s dans les provinces du KwaZulu-Natal (KZN) et du Cap oriental (EC) collectivement entre le 25 mars et le 24 avril 2023.\n\nCela porte \u00e0 5 le nombre total de cas confirm\u00e9s en 2023. Ces cas ont \u00e9t\u00e9 signal\u00e9s dans les provinces de l\u0027EC (n=2), du KZN (n=2) et du Limpopo (LPP) (n=1). Ces chiffres sont \u00e0 comparer aux 7 cas de rage humaine (EC=5, KZN=1, LPP=1) qui ont \u00e9t\u00e9 rapport\u00e9s pour la m\u00eame p\u00e9riode l\u0027ann\u00e9e derni\u00e8re [2022] dans les m\u00eames provinces.\u003c/p\u003e\u003cp\u003e\u003cu\u003e29/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eOreillons\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.nicd.ac.za/confirmation-of-mumps-outbreak-south-africa-11-may-2023/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eEn Afrique du Sud, dans le cadre du suivi de l\u0027\u00e9pid\u00e9mie d\u0027oreillons, l\u0027Institut national sud-africain des maladies transmissibles (NICD), rapporte de la semaine \u00e9pid\u00e9miologique 01 en 2023 (se terminant le 7 janvier 2023) \u00e0 la semaine 17 2023 (se terminant le 26 avril 2023), 1 702 r\u00e9sultats de tests \u00e9taient disponibles, dont 580 positifs pour les oreillons provenant de huit provinces : Eastern Cape (9 (2 %)), Free State (40 (7 %)), Gauteng (64 (11 %)), KwaZulu-Natal (280 (48 %)), Limpopo (11 (2 %)), Mpumalanga (97 (17 %)), North West (57 (10 %)) et Western Cape (22 (4 %)).\n\nLe plus grand nombre de tests positifs pour les oreillons se trouve dans le groupe des 5-9 ans (335 (58%)), suivi par le groupe des 1-4 ans (158 (27%)).\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[[126.63388671875003, 37.7818359375], [126.66455078125, 37.800732421875], [126.66650390625, 37.827929687499996], [126.66679687499999, 37.9171875], [126.75429687500002, 37.978955078125], [126.87890625, 38.1060546875], [126.94003906250003, 38.175585937499996], [127.00966796875002, 38.240527343749996], [127.09033203125, 38.28388671875], [127.16953125000003, 38.304541015625], [127.29404296875003, 38.313281249999996], [127.53271484375, 38.304980468749996], [127.57949218750002, 38.3125], [127.74550781250002, 38.319238281249994], [127.78466796875, 38.30771484375], [127.9052734375, 38.300439453124994], [128.03896484375002, 38.308544921875], [128.10625000000005, 38.32734375], [128.16865234375, 38.359326171875], [128.22314453125, 38.4169921875], [128.279296875, 38.523779296875], [128.33945312500003, 38.607861328125], [128.37460937500003, 38.623437499999994], [128.61884765625, 38.176074218749996], [128.85244140625002, 37.887060546875], [129.05156250000005, 37.677636718749994], [129.33515625, 37.274560546874994], [129.41826171875005, 37.059033203125], [129.42617187500002, 36.925537109375], [129.47343750000005, 36.74189453125], [129.43300781250002, 36.636621093749994], [129.44501953125, 36.470703125], [129.42714843750002, 36.385498046875], [129.392578125, 36.322705078125], [129.39130859375, 36.2021484375], [129.40244140625003, 36.137646484375], [129.403515625, 36.052148437499994], [129.42578125, 36.018798828125], [129.45830078125005, 36.0064453125], [129.509765625, 36.03759765625], [129.57285156250003, 3 4.05126953125], [-6.119531249999994, 54.058886718749996], [-6.218017578125, 54.088720703125]]], [[[-1.0655761718749943, 50.690234374999996], [-1.149365234374983, 50.655712890625], [-1.1758300781249886, 50.615234375], [-1.1960937499999886, 50.59921875], [-1.25146484375, 50.588818359375], [-1.3062988281249943, 50.588525390624994], [-1.515332031249983, 50.669775390625], [-1.563427734374983, 50.66611328125], [-1.5156738281249886, 50.7033203125], [-1.3858398437499773, 50.733544921874994], [-1.3127929687499886, 50.773486328124996], [-1.144238281249983, 50.734716796875], [-1.0655761718749943, 50.690234374999996]]]], "type": "MultiPolygon"}, "id": "52", "properties": {"Couleur": ["Rouge", "Rouge", "Orange", "Rouge", "Rouge", "Vert"], "Country": "United Kingdom", "Disease": ["enterovirus", "A(H5N1)", "Rougeole", "Streptococcus pyogenes", "Dipht\u00e9rie", "AAV2"], "final_color": "red", "legend": "\u003ch4\u003eUnited Kingdom\u003c/h4\u003e\u003cp\u003e\u003cu\u003e18/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eenterovirus\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:red\"\u003eAlerte \u00e9lev\u00e9e\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON465\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eEntre juin 20 22 et mars 2023, 15 cas de myocardite suite \u00e0 infection \u00e0 Enterovirus chez des jeunes enfants: 10 au sud du Pays de Galles et 5 dans le sud-ouest de l\u0027Angleterre. 8 en soins intensifs  IOT + assistance circulatoire. 1 d\u00e9c\u00e8s. Pour 9 enfant, PCR coxsackie B3 ou B4 positive\u003c/p\u003e\u003cp\u003e\u003cu\u003e01/04/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eAAV2\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.nature.com/articles/d41586-023-00570-8\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eEvidence de l\u0027implication du virus AAV2 dans l\u0027\u00e9pid\u00e9mie d\u0027h\u00e9patite d\u0027origine indetermin\u00e9e p\u00e9diatrique d\u0027avril 2022. Cas t\u00e9moins, avec NGS, serologies et FISH: AAV2 retrouv\u00e9 chez 81% des cas et 7% des contr\u00f4les, AAV2 retrouv\u00e9 dans des h\u00e9patocytes balonis\u00e9s  le long d\u0027infiltrat lymphocytaires T sur des biopsies h\u00e9patiques.\u003c/p\u003e\u003cp\u003e\u003cu\u003e08/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eRougeole\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.bbc.com/news/health-65481976\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eD\u00e9j\u00e0 49 cas au premier quadrimestre 2023 , pour 54 sur toute l\u0027ann\u00e9e 2022. majorit\u00e9 des cas \u00e0 Londres.  Les 3/4 des cas sont des cas autochtones. Couverture vaccinnale des moins de 5 ans insuffisante 85%.\u003c/p\u003e\u003cp\u003e\u003cu\u003e19/04/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eStreptococcus pyogenes\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:red\"\u003eAlerte \u00e9lev\u00e9e\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.hpsc.ie/news/title-22663-en.html \n\nhttps://www.ssi.dk/sygdomme-beredskab-og-forskning/sygdomsudbrud/streptokker\n\nhttps://www.gov.uk/government/publications/group-a-streptococcal-infections-activity-during-the-2022-to-2023-season/group-a-streptococcal-infections-13th-update-on-seasonal-activity-in-england\" t 46875, -2.1592773437500057], [33.12470703125001, -2.1578125000000057], [33.05888671875002, -2.1349609375000114], [32.98867187500002, -2.10498046875], [32.89863281250001, -2.0848632812500085], [32.85136718750002, -2.060546875], [32.84707031250002, -1.9789062500000085], [32.82988281250002, -1.9375], [32.88427734375, -1.9044921875000114], [32.94863281250002, -1.9016601562500028], [32.97158203125002, -1.9732421875000057], [33.02734375, -1.9734375000000028], [33.09716796875, -1.9654296875000057], [33.1201171875, -2.0113281250000057], [33.14042968750002, -2.069140625000003], [33.18291015625002, -2.116015625000003], [33.1748046875, -2.1592773437500057]]]], "type": "MultiPolygon"}, "id": "53", "properties": {"Couleur": ["Vert", "Vert", "Orange"], "Country": "United Republic of Tanzania", "Disease": ["Virus de Marbourg", "Rougeole", "Virus de Marbourg"], "final_color": "yellow", "legend": "\u003ch4\u003eUnited Republic of Tanzania\u003c/h4\u003e\u003cp\u003e\u003cu\u003e16/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eRougeole\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.thecitizen.co.tz/tanzania/news/national/why-measles-cases-spiked-in-tanzania-in-the-past-year-4229886 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLes perturbations des services et de la cha\u00eene d\u0027approvisionnement, le d\u00e9tournement des ressources vers les efforts de r\u00e9ponse et les controverses sur les vaccins COVID-19 ont entra\u00een\u00e9 une baisse importante de la couverture syst\u00e9matique dans le pays, laissant les populations vuln\u00e9rables \u00e0 des maladies \u00e9vitables telles que la rougeole. Mme Lotalis Gadau, charg\u00e9e de programme au minist\u00e8re de la sant\u00e9, a d\u00e9clar\u00e9 qu\u0027entre juin 2022 et le 3 mai 2023, il y a eu au moins 3923 cas confirm\u00e9s.\u003c/p\u003e\u003cp\u003e\u003cu\u003e02/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eVirus de Marbourg\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.who.int/emergencies/disease-outbreak-news/item/2023-DON471 \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eFin de l\u0027\u00e9pid\u00e9mie : Le 2 juin 2023, le minist\u00e8re de la sant\u00e9 de la R\u00e9publique-Unie de Tanzanie a d\u00e9clar\u00e9 la fin de la premi\u00e8re \u00e9pid\u00e9mie document\u00e9e de maladie \u00e0 virus de Marburg (MVD). Entre le 21 mars et le 31 mai, neuf cas au total (huit confirm\u00e9s en laboratoire et un probable) ont \u00e9t\u00e9 signal\u00e9s. Tous les cas ont \u00e9t\u00e9 signal\u00e9s dans le district de Bukoba, dans la r\u00e9gion de Kagera. Au total, six d\u00e9c\u00e8s (taux de l\u00e9talit\u00e9 de 67 %) ont \u00e9t\u00e9 signal\u00e9s au cours de l\u0027\u00e9pid\u00e9mie.\u003c/p\u003e\u003cp\u003e\u003cu\u003e23/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eVirus de Marbourg\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://nilepost.co.ug/2023/03/21/tanzania-confirms-outbreak-of-marburg-virus-disease/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e5 d\u00e9c\u00e8s et 7 cas suspects avec fi\u00e8vre, asth\u00e9nie, h\u00e9mat\u00e9m\u00e8se, diarrh\u00e9e\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[[-132.746875, 56.525683593749996], [-132.7576171875, 56.511035156249996], [-132.884716796875, 56.512451171875 news/2023/06/22/alaska-sees-steady-rise-in-babies-diagnosed-with-syphilis/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eAugmentation des cas de Syphilis et Syphilis cong\u00e9nitale li\u00e9e \u00e0 la diminution d\u0027utilisation des pr\u00e9servatifs\u003c/p\u003e\u003cp\u003e\u003cu\u003e20/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eWest nile\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.mesvaccins.net/web/news/20915-premier-cas-humain-d-039-infection-par-le-virus-west-nile-dans-l-039-iowa-pour-2023\" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eAux Etats-Unis, les autorit\u00e9s sanitaires de l\u0027\u00c9tat de l\u0027Iowa signalent le premier cas humain d\u0027infection par le virus West Nile ou virus du Nil occidental (VNO) en 2023 chez une personne \u00e2g\u00e9e (61-80 ans) du comt\u00e9 de Plymouth. En 2022, neuf habitants de l\u0027Iowa ont \u00e9t\u00e9 diagnostiqu\u00e9s avec le virus du Nil occidental, sans aucun d\u00e9c\u00e8s.\n\nAu 13 juin, les Centers for Disease Control and Prevention ont signal\u00e9 13 cas humains de VNO dans 9 \u00c9tats, dont huit cas de maladie neuro-invasive.\u003c/p\u003e\u003cp\u003e\u003cu\u003e05/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003em\u00e9lioidose\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://medicalxpress.com/news/2023-06-cdc-potentially-fatal-bacterial-illness.html \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e1 cas sur le Missisipi (2 cas d\u00e9j\u00e0a siganl\u00e9s en 2022)\u003c/p\u003e\u003cp\u003e\u003cu\u003e22/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003el\u00e9gionnellose\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.nbcboston.com/news/local/health-officials-issue-warning-about-legionnaires-disease-outbreak-associated-with-nh-campground/3002540/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e\u00e9pid\u00e9mie dans un camping du New Hampshire\u003c/p\u003e\u003cp\u003e\u003cu\u003e22/03/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eblastomycose\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.woodtv.com/news/michigan/outbreak-of-rare-fungal-disease-confirmed-in-upper-peninsula/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003e35 cas confirm\u00e9s travaillant dans une papetterie dans le Michigan\u003c/p\u003e\u003cp\u003e\u003cu\u003e19/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003evirus Powassan\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\" https://wgme.com/news/local/maine-records-first-case-death-powassan-virus-this-year-ticks-deer-woodchuck-disease-infection-cdc  \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLe CDC du Maine annonce qu\u0027un habitant du comt\u00e9 de Sagadahoc est d\u00e9c\u00e9d\u00e9 du virus Powassan. Il s\u0027agit du premier cas et du premier d\u00e9c\u00e8s dus au virus Powassan dans le Maine cette ann\u00e9e [2023]. Le CDC indique que la victime adulte a d\u00e9velopp\u00e9 des sympt\u00f4mes neurologiques et est d\u00e9c\u00e9d\u00e9e \u00e0 l\u0027h\u00f4pital. Les autorit\u00e9s indiquent que la personne a probablement \u00e9t\u00e9 infect\u00e9e dans le Maine.\n\nLe virus Powassan est rare. Le Maine a enregistr\u00e9 15 cas depuis 2015, dont 4 en 2022.\n\nIl s\u0027agit du troisi\u00e8me d\u00e9c\u00e8s li\u00e9 au Powassan enregistr\u00e9 dans le Maine depuis 2015. \u003c/p\u003e\u003cp\u003e\u003cu\u003e23/05/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003eSalmonella spp\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:green\"\u003eAlerte faible\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.cdc.gov/salmonella/backyardpoultry-05-23/ \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eLes autorit\u00e9s sanitaires enqu\u00eatent sur des \u00e9pid\u00e9mies de salmonelles survenues dans plusieurs \u00c9tats et li\u00e9es \u00e0 des contacts avec des volailles de basse-cour. Toute volaille de basse-cour peut \u00eatre porteuse de germes de salmonelles qui peuvent vous rendre malade. Prenez toujours des mesures pour rester en bonne sant\u00e9 \u00e0 proximit\u00e9 de votre troupeau.\u003c/p\u003e\u003cp\u003e\u003cu\u003e22/06/2023\u003c/u\u003e : \u003cstrong\u003e\u003cspan style=\"font-size:15px\"\u003ePlasmodium vivax\u003c/span\u003e\u003c/strong\u003e: \u003cstrong\u003e\u003cspan style=\"font-size:14px; color:orange\"\u003eAlerte moyenne\u003c/span\u003e\u003c/strong\u003e - \u003ca href=\"https://www.mesvaccins.net/web/news/20928-au-texas-signalement-d-039-un-cas-autochone-de-paludisme-a-plasmodium-vivax \" target=\"_blank\"\u003eR\u00e9f\u00e9rences\u003c/a\u003e\u003c/p\u003e\u003cp style=\"text-align: justify;\"\u003eApr\u00e8s deux cas de Plasmodium vivax transmis localement \u00e0 Sarasota, en Floride (voir les nouvelles des 7 juin et 22 juin) , signal\u00e9s depuis la fin du mois de mai, les autorit\u00e9s sanitaires de l\u0027Etat du Texas font \u00e9tat aujourd\u0027hui d\u0027un cas de paludisme diagnostiqu\u00e9; chez un r\u00e9sident du Texas qui n\u0027a pas voyag\u00e9 en dehors du pays ou de l\u0027Etat. Selon le d\u00e9partement des services de sant\u00e9 de l\u0027Etat du Texas (DSHS), le paludisme a r\u00e9cemment \u00e9t\u00e9 diagnostiqu\u00e9 chez un habitant du Texas qui travaillait en plein air dans le comt\u00e9 de Cameron. A ce jour, aucun autre cas de paludisme localement acquis n\u0027a \u00e9t\u00e9 identifi\u00e9 au Texas.\n\nLe Texas enregistre en moyenne plus de 120 cas de paludisme li\u00e9s \u00e0 des voyages par an. Le dernier cas de paludisme acquis localement au Texas remonte \u00e0 1994.\u003c/p\u003e"}, "type": "Feature"}, {"geometry": {"coordinates": [[[-53.37060546875, -33.7421875], [-53.419580078124994, -33.77919921875001], [-53.47246093749999, -33.84931640625001], [-53.53452148437499, -34.01748046875001], [-53.742919921875, -34.24951171875], [-53.785302734374994, -34.38037109375], [-54.01025390625, -34.51699218750001], [-54.16855468749999, -34.670703125], [-54.272119140624994, -34.66689453125001], [-54.36533203124999, -34.73271484375], [-54.902294921875, -34.93281250000001], [-55.095117187499994, -34.895117187500006], [-55.23789062499999, -34.89580078125], [-55.37060546875, -34.8076171875], [-55.67314453124999, -34.77568359375], [-55.862939453124994, -34.81093750000001], [-56.117919921875, -34.90791015625001], [-56.19462890624999, -34.90644531250001], [-56.249951171875, -34.90126953125001], [-56.387841796874994, -34.86103515625001], [-56.4630859375, -34.775390625], [-56.85517578125, -34.67666015625001], [-57.17070312499999, -34.45234375000001], [-57.54345703125, -34.448046875], [-57.8291015625, -34.47734375], [-57.8732421875, -34.44765625000001], [-57.9021484374
